pub enum Format<'a> {
    Format0(Subtable0),
    Format1,
    Format2(Subtable2),
    Format3(Subtable3),
}

pub enum SingleSubstitution<'a> {
    Format1 {
        coverage: Coverage,
        delta: i16,
    },
    Format2 {
        coverage: Coverage,
        substitutes: LazyArray16,
    },
}

pub enum SingleAdjustment<'a> {
    Format1 {
        coverage: Coverage,
        value: ValueRecord,
    },
    Format2 {
        coverage: Coverage,
        values: ValueRecordsArray,
    },
}

pub enum PairAdjustment<'a> {
    Format1 {
        coverage: Coverage,
        sets: PairSets,
    },
    Format2 {
        coverage: Coverage,
        classes: (ClassDefinition, ClassDefinition),
        matrix: ClassMatrix,
    },
}

pub enum ContextLookup<'a> {
    Format1 {
        coverage: Coverage,
        sets: SequenceRuleSets,
    },
    Format2 {
        coverage: Coverage,
        classes: ClassDefinition,
        sets: SequenceRuleSets,
    },
    Format3 {
        coverage: Coverage,
        coverages: LazyOffsetArray16,
        lookups: LazyArray16,
    },
}

pub enum ChainedContextLookup<'a> {
    Format1 {
        coverage: Coverage,
        sets: ChainedSequenceRuleSets,
    },
    Format2 {
        coverage: Coverage,
        backtrack_classes: ClassDefinition,
        input_classes: ClassDefinition,
        lookahead_classes: ClassDefinition,
        sets: ChainedSequenceRuleSets,
    },
    Format3 {
        coverage: Coverage,
        backtrack_coverages: LazyOffsetArray16,
        input_coverages: LazyOffsetArray16,
        lookahead_coverages: LazyOffsetArray16,
        lookups: LazyArray16,
    },
}

pub enum Coverage<'a> {
    Format1 {
        glyphs: LazyArray16,
    },
    Format2 {
        records: LazyArray16,
    },
}

pub enum ClassDefinition<'a> {
    Format1 {
        start: GlyphId,
        classes: LazyArray16,
    },
    Format2 {
        records: LazyArray16,
    },
}
